import './Header.css';
import { withRouter } from 'react-router-dom';

const Header = (props) => {
    return (
        <header>
            <h1 className='header-text'>{this.state.text}</h1>
            <Button className='upload' onClick={()=> this.props.history.push('/new')} type="primary" shape="round" size='large'>
            Upload new image
            </Button>
        </header>
    )
}

export default withRouter(Header);
